// SPDX-License-Identifier: MIT
pragma solidity >=0.8.16;
import './StringUtil/StringUtil.sol';
contract HelloWorld{
    function myFirstHelloWorld() virtual public pure returns (string memory){
        return "Hello World! My name is Zhang Pan.";
    }
}
contract HelloMyWorld is HelloWorld{
    string public str3 = super.myFirstHelloWorld();
    string public str4 = "hhhh";
    function myFirstHelloWorld() virtual public pure override returns(string memory){
        string memory str1 = super.myFirstHelloWorld();
        string memory str2 = "Hello World! My name is Zhang San.";
        if (uint(StringUtil.compare(str1,str2)) != 0){
            return " My class number is 201.";
        }else {
            return "It's not me!";
        }
    }
}

learn/StringUtil/StringUtil.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;
library StringUtil{
    enum CompareResult { Equal , Less , Greater , Invalid}
    function compare(string memory str1, string memory str2) public pure returns(CompareResult){
        if (bytes(str1).length == 0){
            return CompareResult.Invalid;
        }else if (bytes(str2).length == 0){
            return CompareResult.Invalid;
        }else if (keccak256(abi.encodePacked(str1)) == keccak256(abi.encodePacked(str2))){
            return CompareResult.Equal;
        }else {
            uint a = 0;
            a = bytes(str1).length;
            if ( a > bytes(str2).length){
                return CompareResult.Greater;
            } else if ( a < bytes(str2).length){
                return CompareResult.Less;
            }
            for (uint i = 0; i <a ;i++ ){
                if (bytes(str1)[i] > bytes(str2)[i]){
                    return CompareResult.Greater;
                }
                if (bytes(str1)[i] < bytes(str2)[i]){
                    return CompareResult.Less;
                }
            }
        }
    }
}

